    reasonNav.on('changed.owl.carousel', function(event) {
      var active = $(this).find('.owl-item.active');
      $(this).find('.owl-item').removeClass('next prev next-2 prev-2');
      var activeIndex = event.item.index;
      var nextIndex = activeIndex+1;

      if (nextIndex > 4) {
        nextIndex=0;
      }

      var nextIndex2 = nextIndex+1;
      var prevIndex = activeIndex-1;
      if (prevIndex == -1) {
        prevIndex == event.item.count-1;
      }
      var prevIndex2 = prevIndex-1;

      if (activeIndex == 0) {
        $(this).attr('data-position','position-1');
      }else if(activeIndex == 1){
        $(this).attr('data-position','position-2');
      }else if(activeIndex == 2){
        $(this).attr('data-position','position-3');
      }else if(activeIndex == 3){
        $(this).attr('data-position','position-4');
      }else if(activeIndex == 4){
        $(this).attr('data-position','position-5');
      }
      $(this).find(".owl-item").eq(prevIndex ).addClass("next")
      $(this).find(".owl-item").eq(prevIndex2).addClass("next-2")
      $(this).find(".owl-item").eq(nextIndex).addClass("prev")
      $(this).find(".owl-item").eq(nextIndex2).addClass("prev-2")
    })


